    private async void updatePassType () {
        if (busPass.PassTypeId != int.Parse (this.selectedType)) {
            this.loading = true;
            try {
                this.busPass = await busPassRepository.updatePassType (this.busPass.BusPassportId, int.Parse (this.selectedType));
                this.loading = false;
            } catch (Exception e) {
                Console.WriteLine (e);
                this.loading = false;

            }
            StateHasChanged ();
        }
    }

